import IUnitInfo from "../../interface/IUnitInfo";
import DefaultStrategy from "../unitStrategy/DefaultStrategy";
import RangeStrategy from "../unitStrategy/ArcherStrategy";
import img from "../../../img/";
export default class BanditUnitInfo extends DefaultStrategy
  implements IUnitInfo {
  _unitType: string;
  _HP: number;
  _damage: number;
  _initiative: number;
  _actionType: void;
  _imgPath: any;
  // _name: string;
  constructor() {
    super(new RangeStrategy());
    this._unitType = "range";
    this._HP = 45;
    this._damage = 30;
    this._initiative = 60;
    // this._name = "bandit";
  }
}
